import React, { Component } from "react";
import Questions from './Questions'
import Procedure from './Procedure'
import "./App.css";

class App extends Component {
  render() {
    return (
      <div>
        <div className="split left">
          <div className="centered">
            <Procedure></Procedure>
          </div>
        </div>

        <div className="split right">
          <div className="centered">
            <Questions></Questions>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
